import React from 'react'
import Product from './Product.js'

function ProductList(props) {
    const product =props.ProductList.map((product)=>{
      <ul>
          <li>{product.model}</li>
      </ul>  
    })
    return (
            <table>
                <tr>
                    <th>Name</th>
                    <th>Price</th>
                </tr>
                <tr>
                    {props.ProductList.map((product)=>{
                        return<td>{product.model}</td>
                    })}
                </tr>

            </table>
              /*{
